const getVideoInfo = () => {
  let video_id = "VA770wpLX-Q";
  fetch(


"http://www.youtube.com/oembed?url=http://www.youtube.com/watch?v="+ video_id +"&format=json"
    ,
    {
      method: "get",
    }
  )
    .then(function (response) {
      console.log(response);
    })
    .catch(function (err) {
      console.log(err);
    });
};

const Media = () => (
  <div>
    <h1>Youtube Code goes here</h1>
    {getVideoInfo()}
  </div>
);

export default Media;
